import Bootstrap from '../component/layouts/bootstrap';

class Login extends React.Component{
    render(){
        return(
            <div>
                <Bootstrap title="Login Account" />

                <div className="bg-img">
                    <div className="container">
                        <div className="row">
                            <p>ok</p>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Login;
